clc; close all; clearvars

%% Initialisation

rng('default'); % if reproducibility of results is needed

%% Data onboarding
% Load the data
load("ws1_data1.mat")
% Find out how the data oriented and determine the sizes

% X has 100 rows and 4 columns, rows are samples and columns are features
unique(y) %[output:6dbf117c]
% The data has two different classes (1, 2)

% Visualise the data
for i=1:4 %[output:group:189d173b]
    figure %[output:252c5abf] %[output:99666631] %[output:9d3dc307] %[output:1ebd755c]
    boxplot(X(:,i),y) %[output:252c5abf] %[output:99666631] %[output:9d3dc307] %[output:1ebd755c]
    xlabel("Class")
    ylabel("Feature values")
    title("Boxplot of feature", i)
end %[output:group:189d173b]

for i=1:4 %[output:group:80fd98bd]
    figure %[output:539b9713] %[output:0e008ef0] %[output:599ad4de] %[output:2906dca5]
    hold on %[output:539b9713] %[output:0e008ef0] %[output:599ad4de] %[output:2906dca5]
    histogram(X(y==1,i))
    histogram(X(y==2,i))
    title("Histogram of feature", i)
   
end %[output:group:80fd98bd]

featureNames = {'Feature 1','Feature 2','Feature 3','Feature 4'};
gplotmatrix(X, [], y, [], [], [], [], [], featureNames); %[output:58c43f16]


%gplotmatrix(X,[],y)

%% Optional: Feature extraction
% Features 3 and 4 separate classes good.
% With features 1 and 2 we get more overlapping but separation is good
% enough.




%% Data division
% Split the data for supervised learning         
idx = randperm(100); 
X_training = X(idx(1:70),:);
X_testing = X(idx(71:100),:);

%%

%% Feature selection
% Enumerate the feature combinations according to the desired number of features
combinations = nchoosek(1:4,2) %[output:8a3523b4]
% We have 6 combinations.
trainclass = y(idx(1:70));
trueclass = y(idx(71:100));

% Evaluate the goodness of the combinations
for i = combinations' %[output:group:902cdeb8]
    m1 = mean(X(y==1, i),1)';
    m2 = mean(X(y==2, i),1)';
    std1 = std(X(y==1, i),1)';
    std2 = std(X(y==2, i),1)';
    
    sigma1 = eye(2).*std1.^2;
    sigma2 = eye(2).*std2.^2;

    FDR_n = (m1-m2)'*(sigma1+sigma2)^(-1)*(m1-m2);
    fprintf('Combination %s: FDR_n = %.4f\n', mat2str(i), FDR_n); %[output:88724ef3]

end %[output:group:902cdeb8]



% knn in addition
for i = combinations' %[output:group:0c909b87]
    traindata = X_training;
    testdata = X_testing;
    traindata = traindata(:,i);
    testdata = testdata(:,i);
    k=3;
    pred = knn(trainclass, traindata, testdata, k);
    accuracy = mean(pred == trueclass);
    fprintf('k = %d, Accuracy = %.2f%%n', k, accuracy*100); %[output:8834bba8]
end %[output:group:0c909b87]
% Choose the best or one of the best combinations

% We get the biggest FDR with combination [3,4], so it's the best
% combination

% Keep only the relevant/exclude the extra features

X_relevant = X(:,3:4);

% Visualise the feature data

gplotmatrix(X_relevant,[],y) %[output:597e665d]

%% Optional: Data normalisation
...

%% Learn the linear classifier parameters
% Estimate the model parameters using the Perceptron cost or the least-squares method
X_new = [X, ones(size(X,1),1)];
X_training_new = X_new(idx(1:70),:);
y_new = y;
y_new(y==1) = -1;
y_new(y==2) = 1;
y_training_new = y_new((idx(1:70)));
w = (X_training_new' * X_training_new) \ (X_training_new' * y_training_new);


%[output:15c9a8d0]
%% Linear classification
% Classify the test set samples using the model
Ypred = sign(X_new(idx(71:100),:) * w);

%% Performance evaluation
% Provide the classification accuracy
acc = mean(Ypred == y_new(idx(71:100)))
% Optional: Study the confusion matrix
...



function testclass = knn(trainclass, traindata, testdata, k)   
    n_test = size(testdata,1);
    testclass = zeros(n_test,1);
    for i = 1:n_test
        % Compute Euclidean distances to all training samples
        dists = sqrt(sum((traindata - testdata(i,:)).^2, 2));
        % Sort distances in ascending order
        [~, idx] = sort(dists);
        k_now = k;
        while k_now > 0
            k_nearest = trainclass(idx(1:k_now));
            
            % Count occurrences of each class 
            counts = accumarray(k_nearest, 1);

            % Find the most frequent class
            [maxCount, pos] = max(counts);

            % Check if two or more classes have an equal highest number of samples among the k nearest neighbours
            if sum(counts == maxCount) == 1
                % If only one class:
                testclass(i) = pos;
                break;
            else
                % If two or more classes
                k_now = k_now - 1; % decrease k
            end
        end
    end
end


